import React from "react";
import meRing from "../..//Assets/meRing.png";
import "./Hero.css";
const Hero = () => {
  return (
    <motion.div whileHover={{ scale: 1.2 }} whileTap={{ scale: 0.8 }}>
      <section className="hero">
        <img src={meRing} alt="myProfile-img" draggable="false" />
      </section>
    </motion.div>
  );
};
export default Hero;
